import React from "react";
import { ActionIcon } from '@mantine/core';
import { IconLayoutSidebar, IconMenu2 } from '@tabler/icons-react';
import ProfileMenu from "./ProfileMenu";
const Header = () => {
    return (
        <div className="bg-blue-400 w-full h-16 flex justify-between px-5 items-center">

            <ActionIcon variant="transparent" size={"xl"} aria-label="Settings">
                <IconMenu2 style={{ width: '90%', height: '90%' }} stroke={2} />
            </ActionIcon>
            <div className="flex gap-5 items-center">
                <ActionIcon variant="transparent" size={"xl"} aria-label="Settings">
                <IconBellRE style={{ width: '90%', height: '90%' }} stroke={2} />
            </ActionIcon>
            </div>
            <ProfileMenu />
        </div>
    )
}
export default Header
